import React from 'react';
import '../contents/css/home/home.css';
import homeimg from '../contents/images/home/homy.jpg';

const Home = (props) => {
    return (
<div>
  <div class="text-center" id="jumb">
    <h1 id="setHead">SpringBoot Crud With React Redux And Mongodb</h1>
  </div>
  <div class="container-fluid">
    <div class="row">
      <div class="col-sm-12">
        <br/>
        <br/>
        <br/>
        <div class="text-center">
          <img class="img-fluid" src={homeimg} alt="img" />
        </div>
        <br/>
        <br/>
        <br/>
      </div>
    </div>
  </div>
</div>
    );
}
export default Home;
